.passenger {
  background: #f0f3ff;
  width: 100%;
  height: calc(100vh - 80px);
  overflow: hidden;
  padding-left: 10px;
  padding-top:10px;
  padding-bottom: 10px;
  position: relative;
}
/* 地图 */
.map2 {
  width:65%;
  height:100%;
  border-radius: 0rem;
  float: left;
  margin-right: 1%;
}
.right{
  width: 33%;
  float: left;
  height: 100%;
  background: rgba(255, 255, 255, 1);
  box-shadow: 0rem 0rem 1rem 0rem rgba(63, 106, 255, 0.08);
}
.zhanbi {
  float: left;
  width:100%;
  height:60%;
  border-radius: 0rem;
  margin-top: 0.5%;
}
.el-tabs__content{
  width: 100%;
  height: 100%;
}
.amap-box .amap-marker .line-marker{
  height: 20px;
  width: 20px;
  border-radius: 10px;
  background-color: rgba(63,106,255, .7);
  text-align: center;
  line-height: 20px;
  margin-top: 20px;
  color: #fff;
}
.pos{
  width: 35%;
  height: 30%;
  font-size: 1.5vh;
  background:rgba(47,49,83,0.5);
  border-radius:3px;
  position: absolute;
  left: 2%;
  top:2%;
}
.pos_header{
  width:90%;
  height:4vh;
  margin: auto;
  background:rgb(47,49,83,0.5);
  margin-top: 5%
}
.pos_list{
  width: 90%;
  height: 4vh;
  margin: auto;
}
.pos_left{
  width: 30%;
  height: 100%;
  float: left;
  line-height: 250%;
  font-family:PingFang SC;
  font-weight:bold;
  color:rgba(255,255,255,1);
  text-indent: 10%;
}
.pos_right{
  width: 69%;
  height: 100%;
  line-height: 250%;
  float: left;
  font-family:PingFang SC;
  font-weight:bold;
  color:rgba(255,255,255,1);
}
.right_table{
  width: 90%;
  margin: auto;
}
